% figure,imshow(tile0_r);



%%% ======== Precinct. ========
PPSize = [5 5]; % PPx and PPy from 15444-1:2016. 

% Confine precincts within sub-band boundaries. [ 5 5 4 3 2 ] for PPx=5 and decompositionLevels=5.
PPLevels(1, 1:decompositionLevels) = min(PPSize(1), floor(log2(subbandSize(1, 1:decompositionLevels))));
PPLevels(2, 1:decompositionLevels) = min(PPSize(2), floor(log2(subbandSize(2, 1:decompositionLevels))));
% Or do they mean option for declaring optional different sizes?
PPLevels(1, resolutionLevels) = min(PPSize(1), floor(log2(subbandSize(1, decompositionLevels))));   % [ 5 5 4 3 2 2]
PPLevels(2, resolutionLevels) = min(PPSize(2), floor(log2(subbandSize(2, decompositionLevels))));

for i = 1:(size(PPLevels, 2))
    precinctSize(1, i) = 2^PPLevels(1, i);
    precinctSize(2, i) = 2^PPLevels(2, i);
end

for i = 1:decompositionLevels
    precinctNumber(1, i) = ceil(subbandSize(1, i) / precinctSize(1, i));
    precinctNumber(2, i) = ceil(subbandSize(2, i) / precinctSize(2, i));
end
precinctNumber(1, resolutionLevels) = ceil(subbandSize(1, decompositionLevels) / precinctSize(1, resolutionLevels));
precinctNumber(2, resolutionLevels) = ceil(subbandSize(2, decompositionLevels) / precinctSize(2, resolutionLevels));



%%% ======== Codeblock. ========
CBSize = [3 3]; % XCB and YCB from 15444-1:2016. 

% Restrict codeblock size by precinct size, as in Eq B-17 from 15444-1:2016. XCB' and YCB' from 15444-1:2016. 
CBMarked(1, 1:decompositionLevels) = min(CBSize(1), PPLevels(1, 1:decompositionLevels) - 1);
CBMarked(2, 1:decompositionLevels) = min(CBSize(2), PPLevels(2, 1:decompositionLevels) - 1);
CBMarked(1, resolutionLevels) = min(CBSize(1), PPLevels(1, resolutionLevels)); % The case of "r == 0" in Eq B-17 from 15444-1:2016.
CBMarked(2, resolutionLevels) = min(CBSize(2), PPLevels(2, resolutionLevels)); 

codeblockSize(1:2, 1:resolutionLevels) = 0;
codeblockNumber(1:2, 1:resolutionLevels) = 0;
for i = 1:decompositionLevels
    codeblockSize(1, i) = 2^CBMarked(1, i);
    codeblockSize(2, i) = 2^CBMarked(2, i);
    
    codeblockNumber(1, i) = ceil(precinctSize(1, i) / codeblockSize(1, i));
    codeblockNumber(2, i) = ceil(precinctSize(2, i) / codeblockSize(2, i));
end
codeblockSize(1, resolutionLevels) = 2^CBMarked(1, resolutionLevels);
codeblockSize(2, resolutionLevels) = 2^CBMarked(2, resolutionLevels);

codeblockNumber(1, resolutionLevels) = ceil(subbandSize(1, decompositionLevels) / codeblockSize(1, resolutionLevels));
codeblockNumber(2, resolutionLevels) = ceil(subbandSize(2, decompositionLevels) / codeblockSize(2, resolutionLevels));



%%% ======== Find all codeblocks. ========


% == for tiles == 


% == for colour components ==   % Or is this step already done in SÃ¸rlie's work? 
tile_component = tile0_r; 


% == for LL band == 
subbandLL = tile_component(1:subbandSize(1, decompositionLevels), 1:subbandSize(2, decompositionLevels));

for p = 0:(precinctNumber(1, resolutionLevels) * precinctNumber(2, resolutionLevels) - 1)
    precinct = T1_Partitioner_tileN(p, subbandLL, precinctSize(:, resolutionLevels));
    for c = 0:(codeblockNumber(1, resolutionLevels) * codeblockNumber(2, resolutionLevels) - 1)
        codeblock = T1_Partitioner_tileN(c, precinct, codeblockSize(:, resolutionLevels));
        % to do: call EBCOT or return codeblock outputs? Include 'LL' info.
    end
end


% == for HL, LH, HH bands for resolutions ==   % This is a layer? Resolution level. 

% To do: Find most suitable order (increment or decrement). 
for reso = decompositionLevels:-1:1
    subbandHL = tile_component(1:subbandSize(2, reso), (subbandSize(1, reso) + 1):(subbandSize(1, reso) * 2));
    subbandLH = tile_component((subbandSize(1, reso) + 1):(subbandSize(1, reso) * 2), 1:subbandSize(2, reso));
    subbandHH = tile_component((subbandSize(1, reso) + 1):(subbandSize(1, reso) * 2), (subbandSize(1, reso) + 1):(subbandSize(1, reso) * 2));

    for p = 0:(precinctNumber(1, reso) * precinctNumber(2, reso) - 1)
        precinct = T1_Partitioner_tileN(p, subbandHL, precinctSize(:, reso));
        for c = 0:(codeblockNumber(1, reso) * codeblockNumber(2, reso) - 1)
            codeblock = T1_Partitioner_tileN(c, precinct, codeblockSize(:, reso));
            % to do: call EBCOT or return codeblock outputs? Include 'HL' info.
        end
        
        precinct = T1_Partitioner_tileN(p, subbandLH, precinctSize(:, reso));
        for c = 0:(codeblockNumber(1, reso) * codeblockNumber(2, reso) - 1)
            codeblock = T1_Partitioner_tileN(c, precinct, codeblockSize(:, reso));
            % to do: call EBCOT or return codeblock outputs? Include 'LH' info.
        end
        
        precinct = T1_Partitioner_tileN(p, subbandHH, precinctSize(:, reso));
        for c = 0:(codeblockNumber(1, reso) * codeblockNumber(2, reso) - 1)
            codeblock = T1_Partitioner_tileN(c, precinct, codeblockSize(:, reso));
            % to do: call EBCOT or return codeblock outputs? Include 'HH' info.
        end
    end
end




